import logo from './logo.svg';
import './App.css';
import axios from "axios";

const url = 'https://valorant-api.com/v1/';
const key = "df7cd00e-d2f8-4562-8758-20b9ed2e5a37";

const host = "https://public-api.tracker.gg/api/v1//valorant/profile/riot/Appekip%23EUNE/overview?season=all";
let search ="playercards";
let uuid = "6c56e968-4b9c-c9d6-068a-109a03b13866";

function App() {

    etsi();
    //setInterval(etsi, 10000);
    //etsi1();

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" id="b"/>
            <p id={"a"}></p>
      </header>
    </div>
  );
}

async function etsi() {

  const response = await fetch(url, search, uuid);
  const data = await response.json();
  console.log(data);
  document.getElementById('a').textContent =data.data.displayName ;
  document.getElementById('b').src=data.data.largeArt;


}



export default App;
